export class ThromboseArtereCentralRetine {
    idThromboseArtereCentralRetine: number;
    PatientId: number;
    Priapisme: boolean;
    Nombre: number;
    Date: string; 
    CeciteBrutale?: boolean;
    FlouVisuel?: boolean;
    Scotome?: boolean;
    Fievre?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    Hospitalisation: boolean;
    LieuHospitalisation?: string;
    FondOeil: boolean;
    Resultat?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    AutreTraitement?: boolean;
  
    constructor() {
      this.idThromboseArtereCentralRetine = 0;
      this.PatientId = 0;
      this.Priapisme = false;
      this.Nombre = 0;
      this.Date = ''; 
      this.CeciteBrutale = false;
      this.FlouVisuel = false;
      this.Scotome = false;
      this.Fievre = false;
      this.Autre = false;
      this.PreciserAutre = '';
      this.Hospitalisation = false;
      this.LieuHospitalisation = '';
      this.FondOeil = false;
      this.Resultat = '';
      this.HyperhydratationPerso = false;
      this.HyperhydratationIv = false;
      this.AntalgiquesPalliesI = false;
      this.AntalgiquePallierIi = false;
      this.AntalgiquePallierIii = false;
      this.TransfusionSimple = false;
      this.EchangeTransfusionnel = false;
      this.AutreTraitement = false;
    }
  }
